//Function to fire when somebody searches for a sw_name
var nameTimer;

function searchEvent(sw_name) {

	//If the sw_name is not equal to the default, find that sw_name and highlight it - mouseover function
	if (sw_name != "") {

		//Change the GIRLS / BOYS label to the chosen sw_name for several seconds
		d3.select(".genderTitle").text(sw_name)
		d3.select(".genderTitle").style("color", color(sw_name));
		clearTimeout(nameTimer);
		nameTimer = setTimeout(function(e) {
			d3.select(".genderTitle").text(gender);
			d3.select(".genderTitle").style("color", null);
		}, 3000);

		//Take all the years in the top 10 of the sw_name and reset the brush
		//to the time between the first and last occurrence
		var subset = nestedFlatData[namesByID[sw_name]].values;
		var minYear = Math.max(startDay, d3.min(subset, function(d) {return d.day;})-1);
		var maxYear = Math.min(endDay, d3.max(subset, function(d) {return d.day;})+1);
		//Call the resetting of the brush
		moveType = "still"
		gBrush.call(brush.extent([minYear, maxYear])).call(brush.event);

		//Wait a bit with making the lines transparent, otherwise the brush functions
		//will reset it again
		setTimeout(function(){
			popUpName.attr("transform", "translate(-100,-100)");

			//First set all opacities low and the chosen one back to 1
			focus.selectAll(".focus").style("opacity", 0.1);
			d3.selectAll(".focus."+sw_name).style("opacity", 1);

			context.selectAll(".context").selectAll(".line").style("opacity", 0.1);
			context.selectAll(".context."+sw_name).selectAll(".line")
				.style("opacity", 1)
				.style("stroke", color(sw_name));
		}, 100);

		//Reset the moving type to an arbitrary word
		setTimeout(function(){
			moveType = "nothing";
		}, 500);

	} else {
		d3.select(".genderTitle").text(gender);
		//Reset all opacities and strokes
		focus.selectAll(".focus").style("opacity", 0.7);
		context.selectAll(".context").selectAll(".line")
			.style("opacity", null)
			.style("stroke", function(c) { return "url(#line-gradient-" + gender + "-" + c.sw_name + ")"; });
	}//else

}//searchEvent

