//Move selected element to the front
d3.selection.prototype.moveToFront = function() {
  return this.each(function(){
    this.parentNode.appendChild(this);
  });
};

//Focus the chart on a sw_name
function changeName(sw_name, sex) {
	if(gender === sex) searchEvent(sw_name);
	else {
		redraw(sex);
		searchEvent(sw_name);
	}//else
}//changeName

//Reset the focus range years
function changeYears(start, end, sex) {
	if(gender === sex) {
		searchEvent("");
		gBrush.call(brush.extent([start, end])).call(brush.event);
	} else {
		redraw(sex);
		gBrush.call(brush.extent([start, end])).call(brush.event);
	}//else
}//changeYears

