function redraw(choice) {
	gender = choice;

	//////////////////////////////////////////////////////////////
	//////////// Switch variables between genders ////////////////
	//////////////////////////////////////////////////////////////

	flatData = flatDataBoys;
	maxPosition = maxPositionBoys;
	nestedFlatData = d3.nest().key(function(d) { return d.sw_name; }).entries(flatData);

	//Change the dataset
	var data = boys;

	//Change id mapping
	namesByID = boyNamesByID;
	//Reset the color domain
	color = colorBoys;

	//Change the color legend gradient rectangle
	colorLegend.selectAll(".colorkey")
		.attr("fill", function(d) {
			return "url(#legendGradientBoy)";
		});

	d3.select(".genderTitle").text(gender);
	//////////////////////////////////////////////////////////////
	/////////////////////// Search box ///////////////////////////
	//////////////////////////////////////////////////////////////

	//Remove previous box
	$('.combobox-container').remove();
	//$('.typeahead').remove();

	//Remove all the previous options
	var select = document.getElementById("searchBox");
	select.options.length = 0;
	select.options[0] = new Option("Search sw_name...", "", true, false)
	//Create new options
	var options = allBoyNames;
	//Put new options into select box
	for(var i = 0; i < options.length; i++) {
		var opt = options[i];
		var el = document.createElement("option");
		el.textContent = opt;
		el.value = opt;
		select.appendChild(el);
	}
	//Create combo box
	$('.combobox').combobox();

	//////////////////////////////////////////////////////////////
	///////////////////////// Context ////////////////////////////
	//////////////////////////////////////////////////////////////

  	//Add the lines to context chart
	var contextWrapper = context.selectAll(".context")
		.data(data, function(d) { return d.sw_name; });

	//UPDATE
	contextWrapper.attr("class", function(d) {return "focus " + d.sw_name ;});
	contextWrapper.selectAll(".line")
		.attr("d", function(d) { return lineAll(d.values); })
		.style("stroke", function(d) {return "url(#line-gradient-" + gender + "-" + d.sw_name + ")"; });

	//ENTER
	contextWrapper
		.enter().append("g")
		.attr("class", function(d) {return "context " + d.sw_name ;})
		.append("path")
			.attr("class", "line")
			.attr("d", function(d) { return lineAll(d.values); })
			.style("stroke", function(d) {return "url(#line-gradient-" + gender + "-" + d.sw_name + ")"; })
			.style("stroke-width", 1.25)
			.attr("clip-path", "url(#clipContext)")
			.style("opacity", 0)
			.transition().duration(750).delay(500)
			.style("opacity", 1);

	//EXIT
	contextWrapper.exit()
		.transition().duration(750)
		.style("opacity", 0)
		.remove();

	//////////////////////////////////////////////////////////////
	////////////////////////// Focus /////////////////////////////
	//////////////////////////////////////////////////////////////
	//Add a g element per sw_name
	var focusWrapper = focus.selectAll(".focus")
		.data(data, function(d) { return d.sw_name; });

	//UPDATE
	focusWrapper.attr("class", function(d) {return "focus " + d.sw_name ;});
	focusWrapper.selectAll(".line")
		.attr("d", function(d) { return lineBrush(d.values); })
//		.style("stroke-width", function(d) {return strokeWidth[maxPosition[namesByID[d.sw_name]].values - 1]; })
        .style("stroke-width", 2)
		.style("stroke", function(d) { return color(d.sw_name); });

	//ENTER
	//Add the lines of the boys to focus chart
	focusWrapper
		.enter().append("g")
		.attr("class", function(d) {return "focus " + d.sw_name ;})
		.append("path")
			.attr("class", "line")
			.attr("clip-path", "url(#clip)")
			.style("pointer-events", "none")
			.style("stroke-linejoin", "round")
			.style("opacity", 0)
			.attr("d", function(d) { return lineBrush(d.values); })
//			.style("stroke-width", function(d) {return strokeWidth[maxPosition[namesByID[d.sw_name]].values - 1]; })
            .style("stroke-width", 2)
			.style("stroke", function(d) {return color(d.sw_name); });
	//Small delay so the brush can run first
	focusWrapper.selectAll(".line")
			.transition().duration(750).delay(500)
			.style("opacity", 0.7);

	//EXIT
	focusWrapper.exit()
		.transition().duration(750)
		.style("opacity", 0)
		.remove();

	//////////////////////////////////////////////////////////////
	///////////////////////// Voronoi ////////////////////////////
	//////////////////////////////////////////////////////////////

	//Remove the previous voronoi map
	voronoiGroup.selectAll("path").remove();
	//Create a new voronoi map including only the visible points
	voronoiGroup.selectAll("path")
		.data(voronoi(flatData.filter(function(d) {return d.day >= xBrush.domain()[0] &  d.day <= xBrush.domain()[1]; })))
		.enter().append("path")
		.attr("d", function(d) { return "M" + d.join("L") + "Z"; })
		.datum(function(d) { return d.point; })
		//.style("stroke", "red")
		.attr("class", "voronoiCells")
		.on("mouseover", mouseover)
		.on("mouseout", mouseout)
		.on("click", function(d) {searchEvent(d.sw_name);});

	//Move the brush handles to the front
	d3.select(".brush").moveToFront();

}//redraw

